import React from 'react';
import Header from './Header';

function App() {

  var contador = 0;

  function incrementCounter(contador) {
    contador++;
  }

  return (

    <>
     <button onClick={incrementCounter}></button>
     <h1>{contador}</h1>

    </>

  );
}

export default App;
